// value - d2, d6, d16, 3d6, 5d12
// max - bool, show max dice value
/**
 *
 * @param value
 * @param max
 * @param output
 * @return {number}
 */
const dice = function (value, max = false, output = 0) {
    const splited = value.split('d');
    const throws = Number(splited[0]) || 1;
    const sides = Number(splited[1]) || 0;
    const random = () => Math.ceil(Math.random() * sides);
    Array(throws).fill(0).forEach((zero, i) => output += random());

    return max ? throws * sides : output;
};

export default dice;

