public class Cuenta {
        
    private int saldo;
    
    public Cuenta(){
        this.saldo = 250; // Se inicializa con un saldo de 250um.
    }
    
    // GETTER
    public int getSaldo(){
        return this.saldo;
    }
    
    // Método PAGAR CARRERA
    public void pagarCarrera(){
        this.saldo -= 100;
    }
    
    // Método COMPRAR MANZANA MÁGICA
    public void comprarManzanaMagica(){
        this.saldo -= 100;
    }
    
    // Método COBRAR PREMIO
    public void cobrarPremio(){
        this.saldo += 250;
    }
    
}

