vector <int> arrFiller(string s) {
    string n = "";
    vector <int> v;

    for (int i = 0; i < s.length(); i++) {
        if (s[i] == ' ') {
            v.push_back(stoi(n));
            n = "";
        }
        else {
            n += s[i];
        }
    }
    return v;
}

