void solve()
{
    int l, r;
    cin >> l >> r;

    int ans = (l == 1);
    int limit = sqrtl(r);
    vb considered(limit + 1, false);
    for (auto p : primes)
    {
        if (p > limit)
            break;
        int x = p;
        while (x * p < r)
        {
            x *= p;
        }
        dbg(x);
        if (x >= l && x <= r)
        {
            ans += x;
            considered[p] = true;
        }
    }

    vb a(r - l + 1, true);
    int s = sqrtl(r);

    for (auto p : primes)
    {
        if (p > s)
            break;
        int fm = p * p;
        if (fm < l)
        {
            if (l % p == 0)
                fm = l;
            else
            {
                fm = l + p - (l % p);
            }
        }
        for (int i = fm; i <= r; i += p)
        {
            a[i - l] = false;
        }
    }
    for (int i = l; i <= r; i++)
    {
        if (a[i - l] && i != 1)
        {
            if (!considered[i - l])
            {
                ans += i;
                dbg(i);
            }
        }
    }
    println(ans);
}

