// Функция за намиране на най-голям общ делител (НОД)
int findGCD(int a, int b) {
    while (b != 0) {
        int temp = b;
        b = a % b;
        a = temp;
    }
    return a;
}

int main() {
    int num1, den1, num2, den2;

    // Въвеждане на числителите и знаменателите
    cin >> num1 >> den1 >> num2 >> den2;

    // Намиране на сбора
    int sumNum = (num1 * den2) + (num2 * den1);
    int sumDen = den1 * den2;

    // Намиране на най-големия общ делител
    int gcd = findGCD(sumNum, sumDen);

    // Съкращаване на дробта
    sumNum /= gcd;
    sumDen /= gcd;

    // Извеждане на резултата
    cout << sumNum << " " << sumDen << endl;

    return 0;
}

#include <iostream>

int най_голям_общ_делител(int a, int b) {
    while (b) {
        a = a % b;
        std::swap(a, b);
    }
    return a;
}

void съкрати_дроб(int& числител, int& знаменател) {
    int нок = най_голям_общ_делител(числител, знаменател);
    числител /= нок;
    знаменател /= нок;
}

