vector<int> graph[N];
vb vis(N, false);

void dfs(vector<int> *graph, int node, vb &vis, vector<int> &ans)
{
    vis[node] = true;
    ans.pb(node);
    for (auto nei : graph[node])
    {
        if (!vis[nei])
        {
            dfs(graph, nei, vis, ans);
        }
    }
}

