using System;
using System.Collections.Generic;
using static PracticingPolygon.Program.Ticket;

namespace PracticingPolygon
{
    internal class Program
    {
        public class Student
        {
            public string student_Name { get; private set; }
            public byte mark { get; set; }

            public Student(string name) 
            { 
                this.student_Name = name;
            }
        }

        public class Ticket
        {
            public class Question
            {
                public string question { get; private set; }
                public string answer { get; private set; }
                public byte points { get; private set; }

                public Question(string question, string answer, byte points)
                {
                    this.question = question;
                    this.answer = answer;
                    this.points = points;
                }

                public bool AnswerQuestion(Ticket ticket)
                {
                    Console.Write($"Вопрос: {question}\n\n" +
                        $"{ticket.student.student_Name} отвечает: ");

                    string user_answer = Console.ReadLine();

                    if(answer != user_answer)
                    {
                        Console.WriteLine("\n[-] Неправильно!Учитель вам задает один из своих любимых вопросов.. \n");

                        if (!AnswerQuestion(ticket, ticket.getFavQuestion()))
                            return false;

                        else return true;
                    }

                    Console.WriteLine("\n[+] Вы ответили правильно! \n");

                    ticket.student.mark += points;

                    return true;
                }

                public bool AnswerQuestion(Ticket ticket, Question question)
                {
                    Console.Write($"{question.question}  \n\n" +
                                  $"{ticket.student.student_Name} отвечает: ");

                    string user_answer = Console.ReadLine();

                    if (question.answer != user_answer)
                    {
                        Console.WriteLine($"\n[Неуд] {ticket.student.student_Name} провалил экзамен.." +
                                          $"Дата пересдачи: {DateTime.Now.AddDays(7)}");
                        
                        return false;
                    }

                    Console.WriteLine("\n[+] Вы ответили правильно на вопрос учителя! \n");

                    ticket.student.mark += question.points;

                    return true;
                }
            }

            public byte id { get; private set; }
            public Student student { get; private set; }

            //2 вопроса и 1 задача = 3 вопроса )
            public List<Question> questions { get; private set; } = new List<Question>(3);

            public List<Question> favourite_Questions { get; private set; } = new List<Question>(3);

            public Ticket(byte id,Student student, List<Question> questions, List<Question> favourite_Questions)
            {
                this.id = id;
                this.student = student;
                this.questions = questions;
                this.favourite_Questions = favourite_Questions;
            }

            public Question getFavQuestion()
            {
                int rand = new Random().Next(0, 2);
                return favourite_Questions[rand];
            }

            public void StartExam()
            {
                Console.WriteLine($"\n[!] Экзамен начинается!Вам выпал билет №{id}\n");

                foreach (Question question in questions)
                {
                    if (!question.AnswerQuestion(this))
                    {
                        student.mark = 2;
                        return;
                    }
                }

                Console.WriteLine($"{student.student_Name} успешно сдал экзамен! " +
                                  $"Оценка {student.mark}.");
            }

        }

        static void Main(string[] args)
        {
            Console.Write("Введите ваше ФИО: ");
            
            string name = Console.ReadLine();

            Student student = new Student(name);

            //Впадлу делать больше 1го
            List<Ticket> tickets = new List<Ticket>(10)
            {
                new Ticket(id: 1,student: student,
             
                questions: new List<Question>
                {
                    new Question("Сколько будет 3+3","6",1),
                    new Question("Сколько будет 1+3","4",2),
                    new Question("Сколько будет 43+3","46",2)
                },

                favourite_Questions: new List<Question>
                {
                    new Question("Столица Бразилии?","Хуйзнает",1),
                    new Question("Ты еблан?","Хуйзнает",1),
                    new Question("Даяебучтоли","хуйзнает",1)
                })
            };

            tickets[0].StartExam();
        }
    }
}

